(73,	1,	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'\n\n\n\n\n\n\n\n\n\n',	'Atque culpa odio temporibus occaecati',	'Quam expedita nemo eum beatae sed esse eum in et est sit et in autem nihil dolores odit aliquid quia cupiditate sapiente totam et voluptas vitae officia inventore quibusdam nam facilis architecto quod nesciunt hic in ut et ipsa architecto rerum quo quod dolorem delectus.',	'inherit',	'closed',	'closed',	'',	'70-revision-v1',	'',	'',	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'',	70,	'http://localhost/apo/il-etait-plusieurs-doigts/public/?p=73',	0,	'revision',	'',	0),
(74,	1,	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'\n\n\n\n\n\n\n',	'Fugit architecto dolor expedita exercitationem exercitationem',	'Dolores qui id recusandae eos maxime nobis quia veritatis laudantium nemo sunt nihil consequatur alias fuga sit ipsam aut facilis eos facilis ad error iusto quo consequatur blanditiis qui ea adipisci quisquam qui excepturi est corporis eos possimus laborum veritatis temporibus a quis distinctio saepe ut voluptatem odit adipisci doloremque neque sint nesciunt suscipit ullam totam sit in dolores beatae et dignissimos delectus voluptates id sint quaerat ipsam reprehenderit eum omnis perspiciatis consequatur repellendus vitae.\n\nExplicabo reiciendis nesciunt iure et quidem non consequuntur ut consequatur dolor exercitationem necessitatibus laboriosam ut voluptatem non neque dolorem voluptatum non officiis et quia quos ut nulla voluptas omnis dolores et qui repellat unde libero fuga et optio quo quam laboriosam aut autem enim quo eos numquam consequatur inventore tempore libero quod sunt vel corporis voluptas sequi.\n\nQuae corrupti fuga nihil eum unde ducimus aut adipisci ea cupiditate id eos veritatis autem aspernatur temporibus animi vitae at officia atque molestiae aperiam reprehenderit in impedit ut hic necessitatibus aut alias earum fugiat earum.',	'inherit',	'closed',	'closed',	'',	'64-revision-v1',	'',	'',	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'',	64,	'http://localhost/apo/il-etait-plusieurs-doigts/public/?p=74',	0,	'revision',	'',	0),
(75,	1,	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'\n\n\n\n\n\n\n\n\n',	'Placeat quam temporibus dicta',	'Facilis recusandae illum sed eligendi doloribus et atque doloribus aut quia tempore doloribus et eum ex culpa id sapiente consequatur et mollitia molestias eius cupiditate facilis amet et aut labore id neque rerum ipsum molestiae hic nesciunt omnis recusandae velit quas voluptas debitis assumenda molestiae atque dolores et molestiae porro aut voluptatem voluptatem molestias ab ipsam mollitia laborum quas itaque aspernatur sit eligendi perferendis porro fugiat libero est commodi vitae esse vero corrupti qui molestiae.',	'inherit',	'closed',	'closed',	'',	'66-revision-v1',	'',	'',	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'',	66,	'http://localhost/apo/il-etait-plusieurs-doigts/public/?p=75',	0,	'revision',	'',	0),
(76,	1,	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'\n\n\n\n\n\n',	'Assumenda quis assumenda tempore consectetur',	'Inventore et consequatur nobis et exercitationem velit sapiente modi id rem adipisci molestiae et rerum fuga ab eveniet deleniti qui sit minus qui eum error error eius aspernatur et est sunt error impedit nisi aut omnis ullam necessitatibus dicta deleniti mollitia repellendus quia explicabo nihil rem doloribus vel est fugiat optio eius saepe et et.\n\nDolores beatae pariatur odio inventore ullam qui iste molestiae aliquam voluptatem temporibus numquam dolor ad assumenda reprehenderit praesentium consequatur est inventore et veritatis id accusantium quo accusantium quam quo doloremque vero sit est explicabo qui sed non minima saepe ut quia nam.\n\nDeserunt deleniti ad rerum inventore aliquid et quis recusandae at cum enim sunt ut facilis fugiat quidem ducimus perferendis non libero nisi ipsam deserunt excepturi et vel nobis nemo ut quis quos quis et ut.',	'inherit',	'closed',	'closed',	'',	'68-revision-v1',	'',	'',	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'',	68,	'http://localhost/apo/il-etait-plusieurs-doigts/public/?p=76',	0,	'revision',	'',	0),
(77,	1,	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'\n\n\n\n\n',	'Rerum beatae cupiditate numquam repellendus nemo',	'Ut sit beatae et quia non unde eaque iusto ut vel sint voluptates corrupti rerum et ut eaque animi dolores minus dolor qui adipisci placeat rerum et vero praesentium et in delectus sapiente quis iure non iure optio voluptatem sunt earum reiciendis explicabo dolorum maiores ad aut ipsam mollitia eum id quia perspiciatis ipsam quam nihil dolorem consequatur ipsum.\n\nLaborum unde consequatur et sunt fuga voluptas qui voluptatem modi repellendus dolores doloribus voluptatum sunt a quaerat ipsa in vitae perspiciatis sit odio accusamus exercitationem totam vitae sint nam necessitatibus laboriosam expedita commodi libero ut magnam qui ut illo eius.',	'inherit',	'closed',	'closed',	'',	'58-revision-v1',	'',	'',	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'',	58,	'http://localhost/apo/il-etait-plusieurs-doigts/public/?p=77',	0,	'revision',	'',	0),
(78,	1,	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'\n\n\n\n\n\n\n\n\n\n\n\n',	'Dicta non officiis praesentium',	'Qui ut beatae architecto consequatur necessitatibus similique eos repellendus eveniet iste nam expedita qui molestias blanditiis qui omnis quis iusto molestias ea quod laudantium aut qui ipsam ea debitis voluptatem sit veniam consequatur voluptatem nesciunt aut eius consequatur voluptatem alias vel excepturi voluptatem non facilis eos illo deleniti debitis nesciunt.',	'inherit',	'closed',	'closed',	'',	'56-revision-v1',	'',	'',	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'',	56,	'http://localhost/apo/il-etait-plusieurs-doigts/public/?p=78',	0,	'revision',	'',	0),
(79,	1,	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'\n\n\n\n',	'Occaecati cupiditate quod non',	'Officiis atque ut quis nesciunt placeat enim rerum qui perferendis laboriosam porro doloremque praesentium et odio esse eligendi laudantium nemo et magnam mollitia sunt mollitia ipsum perspiciatis aperiam saepe consequatur molestiae tempora nobis quo iste ratione neque et laudantium itaque dignissimos omnis quasi expedita aut quos quaerat maxime.\n\nAut libero ut deleniti ratione quo maiores ratione libero consequuntur modi illum saepe et iure ut sit voluptates voluptatem et tenetur magnam ab nihil sed eum debitis nisi est.',	'inherit',	'closed',	'closed',	'',	'62-revision-v1',	'',	'',	'2021-07-19 22:08:26',	'2021-07-19 22:08:26',	'',	62,	'http://localhost/apo/il-etait-plusieurs-doigts/public/?p=79',	0,	'revision',	'',	0),
